import React from 'react';
import './App.css';

class Products extends React.Component {





    render() {
        return (
            <div className="App">
                <p style={{ fontSize: '35px' }}>{this.props.product.name}</p>
                <p>{this.props.product.price} Dollars</p>
                <p>Amount: {this.props.product.amount}</p>
                <button onClick={() => this.props.onIncrement(this.props.product)}>Add to cart</button>
            </div>
        )
    }
}

export default Products;
